import { InputLabel, MenuItem, Select } from "@mui/material";
import React from "react";
import {ChangeFilterType} from "../types/methods.type";
import {allFilters} from "../types/searchFilters.type";
import {FilterType as FT} from "../types/searchFilters.type"
import {FormControl} from "./formControl.component";

export function FilterType({filterType, changeFilterType}:{filterType:FT|null, changeFilterType: ChangeFilterType}) {
    return <FormControl>
        <InputLabel id="filter">Property</InputLabel>
        <Select
            labelId="filter"
            value={filterType}
            onChange={(e)=>changeFilterType(e.target.value)}
        >
            {allFilters.map(f=><MenuItem value={f}>{f}</MenuItem>)}
        </Select>
    </FormControl>;
}
